import logo from './logo.svg';
import './App.css';
import Header from './Components/Header.js';
import Title_desc from './Components/Title_desc.js'

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";

function App() {
  return (
    <>
      <Header/>

      <Router>
      <Switch>
        <Route exact path="/" component={Title_desc}/>
      </Switch>

      </Router>
      </>

  );
}

export default App;
